<!doctype html>
<html>

<body>
    <h2>parse int program</h2>
    <p id="demo"></p>
    <script>
        document.getElementById("demo").innerHTML =
            typeof 23 + "<br>" +
            typeof "bhavya" + "<br>" +
            typeof [1, 2, 3, 4] + "<br>" +
            typeof null + "<br>" +
            typeof hello + "<br>" +
            typeof function () { }; 
    </script>
</body>

</html>
